INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("クリア", "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 5, 24001, 325, 126001, 0, 40011, 1, 2);
INSERT INTO `v1_1bd2db197bc94914a739d9497fb5504bb695ff2edfdb4c26376cea132c736351` VALUES ("プレシア", "お兄。\nきてくれて、うれしい", 2, 6, 24001, 326, 126101, 0, 40011, 1, 2);
